import React from 'react';
import './style1.css'; // Import your styles if needed

const About = () => {
  return (
    <div>
      <section className="header">
        <img src="./images/indexbanner.jpg" className="back-video" alt="Header Background" />
        <nav>
          {/* ... (your navigation code) ... */}
        </nav>
        <div className="aboutme hidden">
          <h9>About Me</h9>
        </div>
      </section>

      <div className="box hidden">
        <img src="images/IMG_2039.jpg" alt="Profile" className="box-img" />
        <h8>Steven Lopez</h8>
        <h9>UI/UX Designer</h9>
        <p>I am a current programmer who specialized in User Interfaces for User Preference with minimalism and optimization.</p>
      </div>
    </div>
  );
};

export default About;
